import React from 'react';
import ReactDOM from 'react-dom';
import ArticleHeader from './components/ArticleHeader/index.js';
import ImageComponent from './components/ImageComponent/index.js';

var data = {
	data: {
			imageUrl: 'https://www.lordabbett.com/content/dam/lordabbett/en/images/topics/Economy-US/Economy-Recession-Puzzle-shutterstock_333096830.jpg',
			"title": "Image Title \"In-place\""
		}
};

				
var xmlhttp = new XMLHttpRequest();
var url = "https://author.dev.lordabbett.xms.systems/content/lordabbett/fr.react.json";


function render(json) {
  
  var obj = JSON.parse(json);
	
  dataImage=obj.data.imageContentReferenceData;
	console.log(dataImage);
	
	
	
   //ReactDOM.render(<ImageComponent  {...data} />, document.getElementById('root'));
}


xmlhttp.onreadystatechange = function() {
  if (this.readyState == 4 && this.status == 200) {   
    render(this.responseText);
  }
};
xmlhttp.open("GET", url, true);
xmlhttp.send();
